import React from "react";

const QUESTIONS = [
  {
    id: 1,
    question: "What Animal is on Mozilla Firefox browser?",
    ans: "Red Panda",
  },
];

const QuestionsList = (props) => {
  return (
    <div>
      <h1>Question is</h1>
      <p>{props.question}</p>
    </div>
  );
};

export default QuestionsList;
